import React from 'react'
import './Sidebar.css'
import dash from '../../assets/dashboard.png'

const Sidebar = () => {
  return (
    <div className='sidebar'>
        <p className='sidebar-item'><img src={dash} alt="" />Dashboard</p>
        <p className='context-item'>Admin</p>
        <p className='context-item'>Polices</p>
    </div>
  )
}

export default Sidebar
